           <strong>1300 390 971</strong> or\\r\\n                <a href=\\"mailto:support@woolworthsatwork.com.au\\">support@woolworthsatwork.com.au</a>\\r\\n              </div>"},{"Group":"AcceptInviteForm","Name":"dateOfBirthHelpText","Value":"A legal requirement for age restricted products e.g. knives, tobacco and alcohol"},{"Group":"AcceptInviteForm","Name":"passwordHelpText","Value":"Your password should be 6 characters or more and contain at least one number"},{"Group":"Registration","Name":"ShowSMSOffer","Value":true},{"Group":"Registration","Name":"ReceiveSampleByDefault","Value":true},{"Group":"AcceptInviteForm","Name":"preferredContactHelpText","Value":"In case we need to contact you for any queries on your order"},{"Group":"Accessibility","Name":"b2bCheckboxText","Value":"If you are using a screen reader, or only use the keyboard to navigate, please turn on the accessibility switch.\\r\\n\\r\\nPlease note this will impact some of the design, but the functionality will be the same."},{"Group":"Accessibility","Name":"OtherText","Value":"\x3c!--<h3 style=\\"font-size: 20px;\\">1. Turn on accessibility setting</h3><p>If you are using a keyboard, screen reader or low vision user, it is recommended that \\"Accessibility\\" is turned on. To activate the accessibility features, switch the toggle located at the top of this page to \'Accessibility On\'.</p><p>Note: By having this setting turned on, styles that enhance the visual presentation of the site are turned off and areas of the site, including products and services may be impacted.</p>--\x3e\\r\\n<h3 style=\\"font-size: 20px;\\">1. Skip links</h3><p>You’ll find the following links at the top of every page, whenever you tab on to the site.</p><ul style=\\"list-style: unset; margin-left: 16px;\\"> <li>Content navigation (categories within the given page)</li> <li>Main Content</li> <li>Cart</li> <li>Accessibility settings</li></ul><h3 style=\\"font-size: 20px;\\">2. Enlarging text and images</h3><p><span>You can enlarge text and images across the site.</span></p><p></p><span>On a PC:</span><ol style=\\"list-style: decimal; margin-left: 16px;\\"> <li>Hold down the ‘Ctrl’ key and press ‘+’ to enlarge.</li> <li>Hold down the ‘Ctrl’ key and press ‘-’ to reduce.</li> <li>To reset hold down ‘Ctrl’ and press ‘0’.</li></ol><span>On an Apple Macintosh computer:</span><ol style=\\"list-style: decimal; margin-left: 16px;\\"> <li>Hold down the ‘Cmd’ (Apple) key and press ‘+’ to enlarge.</li> <li>Hold down the ‘Cmd’ (Apple) key and press ‘-’ to reduce.</li> <li>To reset hold down ‘Cmd’ (Apple) key and press ‘0’.</li></ol><h3 style=\\"font-size: 20px;\\">3. Search tips</h3><p>You’ll find the search box at the top of each page of the site.</p><ul style=\\"list-style: unset; margin-left: 16px;\\"> <li>Use keywords like “bread” or “milk”</li> <li>Enter a brand name to find products from that brand</li> <li>Narrow your search with suggested search terms from your keyword. Use the UP and Down keys on your keyboard to access them.</li></ul><h3 style=\\"font-size: 20px;\\">Overview of accessibility</h3><p>Wherever possible, we follow the following criteria in the building and maintenance of this site:</p><ul style=\\"list-style: unset; margin-left: 16px;\\"> <li>Use web fonts so all text is easy to read</li> <li>Include alt tags for images to convey information</li> <li>Provide consistent navigation</li> <li>Arrange content in a logical manner</li> <li>Clearly highlight the area of focus for easier keyboard navigation</li></ul><h3 style=\\"font-size: 20px;\\">Browsers and assistive technology</h3><p>We continually optimise the website for the latest browsers and assistive technologies, so it’s always worth checking that you are using the latest version of your preferred browser.</p><h3 style=\\"font-size: 20px;\\">Help and feedback</h3><p>If you are having any difficulties or have any ideas to improve the site, please contact us.</p>"},{"Group":"Accessibility","Name":"PhoneText","Value":"<p style=\\"font-size: 14px; line-height: 20px;\\"> <strong>Please call us on </strong> <br /> <a style=\\"font-size: 14px; line-height: 20x;\\" href=\\"TEL:1300390971\\" >1300 390 971</a ></p><p style=\\"font-size: 12px; line-height: 16px;\\"> <strong>Monday to Friday </strong> <br /> 7:00 - 17:00 <br /> </p><p style=\\"font-size: 12px; line-height: 16px;\\"> <strong>After hours call </strong> <br /> <a style=\\"font-size: 12px; line-height: 16px;\\" href=\\"TEL:1800000610\\">1800 000 610</a></p>"},{"Group":"Accessibility","Name":"EmailText","Value":"<p style=\\"font-size: 14px; line-height: 20px;\\"> <strong>Please email us at </strong> <br /> <a style=\\"font-size: 14px; line-height: 20x;\\" href=\\"support@woolworthsatwork.com.au\\">support@woolworthsatwork.com.au</a ></p><p style=\\"font-size: 12px; line-height: 16px;\\"> We will try to respond to your email within 24-48 hours.</p>"},{"Group":"orderManagement","Name":"cancelOrderModalListB2b","Value":"<li>Your order will be cancelled if you click the Yes button.</li>\\r\\n      <li>If you do cancel, a refund will be processed to your original payment method within 7 business days</li>"},{"Group":"orderManagement","Name":"cancelOrderModalContentTextB2b","Value":"For more information please see <a href=\\"/shop/page/about-us/terms-and-conditions\\">Terms & Conditions</a> or <a href=\\"/shop/discover/about-us/help-and-support-faq\\">FAQs</a>"},{"Group":"orderManagement","Name":"noActiveOrderTextB2b","Value":"You have no active orders."},{"Group":"ResetPassword","Name":"RequestResetCopyB2b","Value":"Please enter the email address linked to your account and we’ll send you an email with a link to reset your password."},{"Group":"ResetPassword","Name":"PasswordReminderContactUsLinkB2b","Value":"https://atwork.woolworths.com.au/shop/page/about-us/contact-us"},{"Group":"OrderConfirmation","Name":"InformationMessage","Value":"Check out our <a style=\\"text-decoration:underline\\" href=\\"/shop/page/help-and-support-faq\\">
